# @dev Implementation of ERC-20 token standard, with extensions
# @author Takayuki Jimba (@yudetamago)
# @author LLJewelJ
# https://github.com/ethereum/EIPs/blob/master/EIPS/eip-20.md


from vyper.interfaces import ERC20
from vyper.interfaces import ERC20Detailed

implements: ERC20
implements: ERC20Detailed

event OwnershipTransferred:
    previousOwner: indexed(address)
    newOwner: indexed(address)

event MinterAdded:
    minter: indexed(address)

event MinterRemoved:
    minter: indexed(address)

event Transfer:
    sender: indexed(address)
    receiver: indexed(address)
    value: uint256

event Approval:
    owner: indexed(address)
    spender: indexed(address)
    value: uint256

name: public(String[64])
symbol: public(String[32])
decimals: public(uint8)

# NOTE: By declaring `balanceOf` as public, vyper automatically generates a 'balanceOf()' getter
#       method to allow access to account balances.
#       The _KeyType will become a required parameter for the getter and it will return _ValueType.
#       See: https://vyper.readthedocs.io/en/v0.1.0-beta.8/types.html?highlight=getter#mappings
balanceOf: public(HashMap[address, uint256])
# By declaring `allowance` as public, vyper automatically generates the `allowance()` getter
allowance: public(HashMap[address, HashMap[address, uint256]])
# By declaring `totalSupply` as public, we automatically create the `totalSupply()` getter
totalSupply: public(uint256)

owner: public(address)
isMinter: public(HashMap[address, bool])


@external
def __init__():
    self.name     = "Greedy Merchant Jewel"
    self.symbol   = "gmJEWEL"
    self.decimals = 18

    self.owner                = msg.sender
    self.isMinter[msg.sender] = True


@external
def transfer(_to : address, _value : uint256) -> bool:
    """
    @dev Transfer token for a specified address
    @param _to The address to transfer to.
    @param _value The amount to be transferred.
    """
    # NOTE: vyper does not allow underflows
    #       so the following subtraction would revert on insufficient balance
    self.balanceOf[msg.sender] -= _value
    self.balanceOf[_to] += _value
    log Transfer(msg.sender, _to, _value)
    return True


@external
def transferFrom(_from : address, _to : address, _value : uint256) -> bool:
    """
     @dev Transfer tokens from one address to another.
     @param _from address The address which you want to send tokens from
     @param _to address The address which you want to transfer to
     @param _value uint256 the amount of tokens to be transferred
    """
    # NOTE: vyper does not allow underflows
    #       so the following subtraction would revert on insufficient balance
    self.balanceOf[_from] -= _value
    self.balanceOf[_to] += _value
    # NOTE: vyper does not allow underflows
    #      so the following subtraction would revert on insufficient allowance
    self.allowance[_from][msg.sender] -= _value
    log Transfer(_from, _to, _value)
    return True


@external
def approve(_spender : address, _value : uint256) -> bool:
    """
    @dev Approve the passed address to spend the specified amount of tokens on behalf of msg.sender.
         Beware that changing an allowance with this method brings the risk that someone may use both the old
         and the new allowance by unfortunate transaction ordering. One possible solution to mitigate this
         race condition is to first reduce the spender's allowance to 0 and set the desired value afterwards:
         https://github.com/ethereum/EIPs/issues/20#issuecomment-263524729
    @param _spender The address which will spend the funds.
    @param _value The amount of tokens to be spent.
    """
    self.allowance[msg.sender][_spender] = _value
    log Approval(msg.sender, _spender, _value)
    return True


@external
def mint(_to: address, _value: uint256):
    """
    @dev Mint an amount of the token and assigns it to an account.
         This encapsulates the modification of balances such that the
         proper events are emitted.
    @param _to The account that will receive the created tokens.
    @param _value The amount that will be created.
    """
    assert self.isMinter[msg.sender] == True # dev: not minter
    assert _to != ZERO_ADDRESS # dev: not burn
    self.totalSupply += _value
    self.balanceOf[_to] += _value
    log Transfer(ZERO_ADDRESS, _to, _value)


@internal
def _burn(_to: address, _value: uint256):
    """
    @dev Internal function that burns an amount of the token of a given
         account.
    @param _to The account whose tokens will be burned.
    @param _value The amount that will be burned.
    """
    assert _to != ZERO_ADDRESS
    self.totalSupply -= _value
    self.balanceOf[_to] -= _value
    log Transfer(_to, ZERO_ADDRESS, _value)


@external
def burn(_value: uint256):
    """
    @dev Burn an amount of the token of msg.sender.
    @param _value The amount that will be burned.
    """
    self._burn(msg.sender, _value)


@external
def burnFrom(_to: address, _value: uint256):
    """
    @dev Burn an amount of the token from a given account.
    @param _to The account whose tokens will be burned.
    @param _value The amount that will be burned.
    """
    self.allowance[_to][msg.sender] -= _value
    self._burn(_to, _value)

@external
def redeem(_to: address, _value: uint256):
    assert self.isMinter[msg.sender] == True # dev: not minter
    self._burn(_to, _value)

@internal
def _transferOwnership(_to: address):
    """
    @dev Transfer ownership of the token, and therefore admin rights, to a given account. Internal function without access restriction.
    @param _to The account that will receive ownership rights.
    """
    oldOwner: address = self.owner
    self.owner = _to
    log OwnershipTransferred(oldOwner, _to)


@external
def transferOwnership(_to: address):
    """
    @dev Transfer ownership of the token, and therefore admin rights, to a given account. Can only be called by current owner.
    @param _to The account that will receive ownership rights.
    """
    assert msg.sender == self.owner # dev: not admin
    assert _to != ZERO_ADDRESS # dev: cant destroy responsibility
    self._transferOwnership(_to)


@internal
def _addMinter(_minter: address):
    """
    @dev Add an address to the list of addresses permitted to mint new tokens. Internal function with no access restrictions.
    @param _minter The account that will receive minting rights.
    """
    self.isMinter[_minter] = True
    log MinterAdded(_minter)


@internal
def _removeMinter(_minter: address):
    """
    @dev Remove an address from the list of addresses permitted to mint new tokens. Internal function with no access restrictions.
    @param _minter The account that will receive minting rights.
    """
    self.isMinter[_minter] = False
    log MinterRemoved(_minter)


@external
def addMinter(_minter: address):
    """
    @dev Add an address to the list of addresses permitted to mint new tokens. Can only be called by current owner.
    To be used if needed to migrate PawnShop
    @param _minter The account that will receive minting rights.
    """
    assert msg.sender == self.owner # dev: only admin
    assert _minter != ZERO_ADDRESS # dev: why do this
    self._addMinter(_minter)


@external
def removeMinter(_minter: address):
    """
    @dev Remove an address from the list of addresses permitted to mint new tokens. Can only be called by current owner.
    @param _minter The account that will receive minting rights.
    """
    assert msg.sender == self.owner # dev: only admin
    assert _minter != ZERO_ADDRESS # dev: why do this
    self._removeMinter(_minter)
